public class InnerTemplateTemplateDefinitionFactory(Action<Humidifier.PCAConnectorAD.TemplateTypes.TemplateDefinition> factoryAction = null) : SubResourceFactory<Humidifier.PCAConnectorAD.TemplateTypes.TemplateDefinition>
{

    internal InnerTemplateTemplateV4Factory TemplateV4Factory { get; set; }

    internal InnerTemplateTemplateV3Factory TemplateV3Factory { get; set; }

    internal InnerTemplateTemplateV2Factory TemplateV2Factory { get; set; }

    protected override Humidifier.PCAConnectorAD.TemplateTypes.TemplateDefinition Create()
    {
        var templateDefinitionResult = CreateTemplateDefinition();
        factoryAction?.Invoke(templateDefinitionResult);

        return templateDefinitionResult;
    }

    private Humidifier.PCAConnectorAD.TemplateTypes.TemplateDefinition CreateTemplateDefinition()
    {
        var templateDefinitionResult = new Humidifier.PCAConnectorAD.TemplateTypes.TemplateDefinition();

        return templateDefinitionResult;
    }
    public override void CreateChildren(Humidifier.PCAConnectorAD.TemplateTypes.TemplateDefinition result)
    {
        base.CreateChildren(result);

        result.TemplateV4 ??= TemplateV4Factory?.Build();
        result.TemplateV3 ??= TemplateV3Factory?.Build();
        result.TemplateV2 ??= TemplateV2Factory?.Build();
    }

} // End Of Class

